import React from 'react';
import { Routes } from 'react-router-dom';
import './App.css';
import Navbar from './components/Navbar/Navbar';
import Home from './pages/Home/Home';

function App() {
  return (
    <Routes>

      <Navbar/>
      <Route path="/" element={ <Home/>}> </Route>

    </Routes>
  );
}

export default App;
